description:
Welcome to Fur Pi, the sexiest sorority house on campus! These shapely young sirens are majoring in carnal cavorting, and can't wait to delve into their sultry studies!
From a tight-bodied cheerleader who takes on the swarthy black football captain to a pair of swinging sisters who turn the backyard pool into a bubbling cauldron of lust, it's never a dull moment at this hot-to-trot house. There's action occurring around every corner, behind every staircase, under every sheet! Even house mother Cheri Taylor gets in on the fun, treating one of the gals' buffed boyfriends to a feverish fling. In the end, they gals get together with the team for an awesome orgy that leaves everyone smiling! What a rush!

